type ReduxType = ReturnType<typeof mapStateToProps>
class Loans extends Component<ReduxType> {

  render() {
    const { loans } = this.props
    return (
      <ul>
        {loans.map((loan: any) => 
          <li key={loan.id}>{loan.title}</li>
          // <li key={loan.id}>{loan.title}</li>
        )}
      </ul>
    )
  } 
}


export default connect(mapStateToProps)(Loans)
